import React, { Component } from 'react';
import { connect } from "react-redux";
import kozel from "../../../img/kozel.img";
import "./MainBody.css";
import axios from "axios";
import {getOrigamiList} from "../../../ac/getOrigamiList";

class MainBody extends Component {

    componentDidMount() {
        axios.post('http://localhost:5002/api/origami/list').then(
            (response) => {
                this.props.getOrigamiList(response);
                console.log(response);
            }
        ).catch( () => {
            console.log("ssdds")
        })
    }

    render() {




        return (
            <div className="main-body-block">
                <h2>{this.props.origamiList.data[0]}</h2>
                <p>В нашем клубе имени знаменитого козла Киркорова вы можете найти не только</p>
                <p>инструкции к прикосновению к его детородному органу.</p>
                <p>Но также подробные указания к тому, как сложить из него нечто прекрасное</p>
                <p>Земля пухом</p>
                <img src = {kozel} />
            </div>
        );
    }
}

const mapStateToProps = (state) => ({
   origamiList: state.origamiList
});

const mapDispatchToProps = {
  getOrigamiList: getOrigamiList
};

export default connect(mapStateToProps, mapDispatchToProps)(MainBody);
